values:
i ask myself on a regualr basis, why? why did you change to crcp at school.&nbsp; I didn't realize the emotional&nbsp; pain of not having studio classes.&nbsp; I am not used to so much academics. essays....lectures...midterms...and my most feared presentations.&nbsp;&nbsp; 

i have two history midterms today, i have never had to learn so many dates.&nbsp; i shouldn't be complaining about being educated and more cultured....but i want tooo paaaaaaint-uh!!!! and i have no free time because there is always something to read and write about . 

i also find my new breed of classmates...difficult to approach. the few that i have spoken too all seem to be stuck up little princes and princess. sigh...toronto wins again.

The magnitude of today is 8+++

I feel like the sutures of my skull are grinding causing the worse stress headache i have ever had.&nbsp;&nbsp;

i am having a self loathing day, nothing i do or say seems to be the right thing.&nbsp; i feel like my boss things i'm a stupid useless tit, i never get any of his jokes. i keep lashing out, i can't control my emotions.&nbsp;

this sound so pathetic but i want my mom.
